import {
  GET_PATIENTS_SUCCESS,
  GET_PATIENTS_ERROR,
} from "../actions/actionTypes";

const initialState = {
  movies: [],
  movie: {},
  error: null,
};

export default function patientReducer(state = initialState, action) {
  switch (action.type) {
    case GET_PATIENTS_SUCCESS:
      return {
        ...state,
        movies: action.payload,
      };

    case GET_PATIENTS_ERROR:
      return {
        ...state,
        error: action.error,
      };

    default:
      return state;
  }
}
